  tambien: "FONPRONVEN tambi\xE9n se enfoca en crear conciencia en el p\xFAblico\n  para que conozca y aprecie el ron venezolano, identificado con\n  los sellos distintivos del ron de Venezuela y avalado por la\n  D.O.C. De esta manera se puede apreciar el producto y establecer\n  diferencias con otros rones.",
  integran: "FONPRONVEN lo integran directivos de las empresas productoras de\n  rones en Venezuela: Alcoholes y A\xF1ejos Monagas, Alnova, Central\n  de Licores Unidos de Venezuela C.A. (Celiveca), Complejo\n  Industrial Licorero del Centro, Corporaci\xF3n Alcoholes del\n  Caribe, Destiler\xEDa Car\xFApano, Destiler\xEDas Unidas S.A (DUSA),\n  Destiler\xEDa Veroes, Diageo Venezuela, Industrias Bravo, Ron Santa\n  Teresa y Rones del Caribe.",
  mision: "Misi\xF3n",
  promover: "Promover nacional e internacionalmente el ron venezolano,\n  destacando como un valor agregado la Denominaci\xF3n de Origen\n  Controlada Ron de Venezuela, velar por el cumplimiento de\n  los requisitos que identifican los rones venezolanos y\n  porque conserven sus principales diferencias para que\n  contin\xFAen destac\xE1ndose en el mundo.",
  vision: "Visi\xF3n",
  vision1: "Que la Denominaci\xF3n de Origen Controlada sea la marca que\n  identifique la \xF3ptima calidad de nuestros rones, agrupando\n  bajo esa etiqueta a los mejores del mundo. Destacar que la\n  D.O.C representa un valor agregado en los destilados\n  venezolanos que se identifican con el sello D.O.C Ron de\n  Venezuela.",
  valores: "Valores de la organizaci\xF3n",
  entusiasmo: "Entusiasmo:",
  entusiasmo1: "A trav\xE9s del conocimiento,\n  la constancia y la tecnolog\xEDa hemos sido capaces de alcanzar\n  valores \xF3ptimos de calidad en el ron de Venezuela y se ha\n  logrado que este prestigio se mantenga en el tiempo.",
  profesionalismo: "Profesionalismo:",
  profesionalismo1: "Se persigue satisfacer las expectativas del mercado nacional e\n  internacional con altos est\xE1ndares de calidad que determinan\n  el \xE9xito y la competitividad a trav\xE9s del compromiso de\n  desarrollar el mejor ron del mundo.",
  colaboracion: "Colaboraci\xF3n:",
  colaboracion1: "La instituci\xF3n busca unir esfuerzos y aportar lo mejor de cada\n  marca para desarrollar objetivos comunes, aumentar la\n  participaci\xF3n y el compromiso en la generaci\xF3n de ideas e\n  iniciativas que optimicen la calidad y los niveles de\n  competitividad."
